import React from "react";
import Image1 from "./images/carouselimages/carousel-2.jpg";
import Image2 from "./images/carouselimages/carousel-2.jpg";
import Image3 from "./images/carouselimages/carousel-3.jpg";

import Carousel from "react-bootstrap/Carousel";

function ImageSlider() {
  return (
    <div>
      <Carousel id="sampleSlide" indicators={false}>
        <ol className="carousel-indicators">
          <li
            data-target="#sampleSlide"
            data-slide-to="0"
            className="active"></li>
          <li data-target="#sampleSlide" data-slide-to="1"></li>
          <li data-target="#sampleSlide" data-slide-to="2"></li>
        </ol>
        <Carousel.Item>
          <img className="d-block w-100" src={Image1} alt="First slide" />
        </Carousel.Item>
        <Carousel.Item>
          <img className="d-block w-100" src={Image2} alt="Second slide" />
        </Carousel.Item>
        <Carousel.Item>
          <img className="d-block w-100" src={Image3} alt="Third slide" />
        </Carousel.Item>
      </Carousel>
    </div>
  );
}

export default ImageSlider;
